// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import HomePage from './HomePage';
import MapRotationPage from './MapRotationPage';
import AgentsPage from './AgentsPage';
import AgentDetailPage from './AgentDetailPage'; // 요원 상세 페이지 import 추가
import RankPage from './RankPage';
import EsportsPage from './EsportsPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/maps" element={<MapRotationPage />} />
        <Route path="/agents" element={<AgentsPage />} />
        <Route path="/agents/:agentName" element={<AgentDetailPage />} /> {/* 상세페이지 경로 등록 */}
        <Route path="/rank" element={<RankPage />} />
        <Route path="/esports" element={<EsportsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
